import React from 'react';

function TransactionHistory({ transactions, onDeleteTransaction }) {
    return (
        <div>
            <h2>Transaction History</h2>
            <h4 className='Transaction_list_heading'>Type</h4>
            <h4 className='Transaction_list_heading'>Name</h4>
            <h4 className='Transaction_list_heading'>Date</h4>
            <h4 className='Transaction_list_heading'>Amount</h4>
            <ul className='transactions'>
                {
                    transactions.map((data) => 
                        <li key={data.id}>
                            <div>{data.billtype}</div>
                            <div>{data.name}</div>
                            <div>{data.date}</div>
                            <div>
                                <span>₹ {data.amount}</span>
                                <button onClick={() => onDeleteTransaction(data.id)}>␡</button>
                            </div>
                        </li>
                    )
                }
            </ul>
        </div>
    )
}

export default TransactionHistory;
